import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/dataset-browser',
    name: 'DatasetBrowser',
    component: () => import('@/views/DatasetBrowser.vue')
  },
  {
    path: '/dataset-features',
    name: 'DatasetFeatures',
    component: () => import('@/views/DatasetFeatures.vue')
  },
  {
    path: '/leaderboard',
    name: 'Leaderboard',
    component: () => import('@/views/Leaderboard.vue')
  },
  {
    path: '/paper-citations',
    name: 'PaperCitations',
    component: () => import('@/views/PaperCitations.vue')
  },
  {
    path: '/community',
    name: 'Community',
    component: () => import('@/views/Community.vue')
  },
  {
    path: '/dataset-description',
    name: 'DatasetDescription',
    component: () => import('@/views/DatasetDescription.vue')
  },
  {
    path: '/practice-cases',
    name: 'PracticeCases',
    component: () => import('@/views/PracticeCases.vue')
  },
  {
    path: '/dataset-download',
    name: 'DatasetDownload',
    component: () => import('@/views/DatasetDownload.vue')
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
